import {Fragment} from "react"
import {useSelector} from "react-redux"
import EnteryItem from "./Entery-item"
const DiaryEntery = () => {
    const entries =  useSelector(state => state.entries)
    console.log(entries)
   const  list = entries.map(data => {
       return <EnteryItem title={data.title} topic={data.topic}/>
   })
    return (
        <Fragment>
        <h2>Latest Enteries</h2>
        <section className="entery-grid">
            {list}
        </section>
        </Fragment>

    )
}
export default DiaryEntery
